def test_convertDictLRTBToListXYWH():
    bbox_test_dict = [{'label': 'truck', 'left': 240, 'right': 260, 'top': 450, 'bottom': 550},
            {'label': 'truck', 'left': 440, 'right': 460, 'top': 550, 'bottom': 650},
            {'label': 'truck', 'left': 540, 'right': 560, 'top': 450, 'bottom': 550},
            {'label': 'truck', 'left': 240, 'right': 260, 'top': 150, 'bottom': 250}]
    bbox_test_ls = [["truck", 250, 500, 20, 100],
                    ["truck", 450, 600, 20, 100],
                    ["truck", 550, 500, 20, 100],
                    ["truck", 250, 200, 20, 100]]

    assert convertDictLRTBToListXYWH(bbox_test_dict) == bbox_test_ls
    assert convertListXYWHToDictLRTB(bbox_test_ls) == bbox_test_dict
    assert convertDictLRTBToListXYWH(convertListXYWHToDictLRTB(bbox_test_ls)) == bbox_test_ls
    assert convertListXYWHToDictLRTB([]) == []
    assert convertDictLRTBToListXYWH({}) == []

def test_convertLabelNamesToNumber():
    bbox_test_ls_in = [["truck", 250, 500, 20, 100],
                    ["car", 450, 600, 20, 100],
                    ["people", 550, 500, 20, 100],
                    ["car", 250, 200, 20, 100]]
    bbox_test_ls_out = [[5, 250, 500, 20, 100],
                    [3, 450, 600, 20, 100],
                    [1, 550, 500, 20, 100],
                    [3, 250, 200, 20, 100]]
    assert convertLabelNamesToNumber([], {}) == []
    assert convertNumberToLabelNames([], {}) == []
    assert convertLabelNamesToNumber(bbox_test_ls_in, VIDSDRONE_OBJECT_CATEGORY_TO_NUMBER) == bbox_test_ls_out
    assert convertLabelNamesToNumber([], VIDSDRONE_OBJECT_CATEGORY_TO_NUMBER) == []
    assert convertLabelNamesToNumber(bbox_test_ls_in, {"truck": 5, "car": 3, "people": 1}) == bbox_test_ls_out
    assert convertNumberToLabelNames(bbox_test_ls_out, VIDSDRONE_OBJECT_CATEGORY_TO_NUMBER) == bbox_test_ls_in
    assert convertNumberToLabelNames(convertLabelNamesToNumber(bbox_test_ls_in, VIDSDRONE_OBJECT_CATEGORY_TO_NUMBER), VIDSDRONE_OBJECT_CATEGORY_TO_NUMBER) == bbox_test_ls_in





