def test_parseBBox_to_List():
    bbox_test = "5 0.474632 0.828758 0.104412 0.100654\n5 0.485662 0.751634 0.108824 0.079739\n4 0.484559 0.686275 0.113235 0.078431\n4 0.511029 0.614379 0.097794 0.075817"
    bbox_test_ls = [[5, 0.474632, 0.828758, 0.104412, 0.100654],
                    [5, 0.485662, 0.751634, 0.108824, 0.079739],
                    [4, 0.484559, 0.686275, 0.113235, 0.078431],
                    [4, 0.511029, 0.614379, 0.097794, 0.075817]]
    assert parseYoloBBoxStringToList(bbox_test) == bbox_test_ls
    assert parseListToYoloBBoxString(parseYoloBBoxStringToList(bbox_test)) == bbox_test
    assert parseYoloBBoxStringToList(parseListToYoloBBoxString(bbox_test_ls)) == bbox_test_ls

